.code
MAIN PROC FAR
	                mov  ax, @data
	                mov  ds, ax

	                mov  ax, graphicsMode
	                mov  bx, 0100h
	                int  10h
                
	                MOV  AX, 0
	                INT  33h

	                MOV  AX, 1
	                INT  33h

	                MOV  BX, 0
	                call drawgamebtn
                    call drawchatbtn

	LOOP1:          
	                mov  AX, 3
	                INT  33h

	                test BX, 1                	; check if key is pressed
	                JZ   LOOP1
	                CMP  CX, gamebtnOffset    	; check min x
	                JL   LOOP1
	                MOV  AX, gamebtnOffset    	; check max x
	                ADD  AX, btnsize
	                CMP  CX, AX
	                JG   LOOP1
	                CMP  DX, gamebtnOffset + 2	; check min y
	                JL   LOOP1
	                MOV  AX, gamebtnOffset
	                ADD  AX, btnsize + 2      	; check if game button is pressed
	                CMP  DX, AX
	                JG   CHECK2
	; Game button is pressed
	                MOV  CX, 10
	                MOV  DX, 10
	                MOv  AL, 3
	                MOV  AH, 0ch
	                INT  10H
	                JMP  LOOP1
	CHECK2:         
	                MOV  AX, chatbtnOffset
	                ADD  AX, btnsize + 2
	                CMP  DX, AX
	                JG   CHECK3
	;Chat button is pressed
	                MOV  CX, 10
	                MOV  DX, 5
	                MOv  AL, 4
	                MOV  AH, 0ch
	                INT  10H
	                JMP  LOOP1
	CHECK3:         
	;Exit button is pressed
	                JMP  LOOP1
        

MAIN ENDP

drawgamebtn PROC
	; initialize containers
	                mov  SI, offset gamebtn
	                mov  cx, btnsize          	;Column X
	                mov  dx, btnsize + 2      	;Row Y
	                mov  ah, 0ch              	;Draw Pixel Command
	Drawitgamebtn:  
	                mov  bl, [SI]             	;use color from array color for testing
	                and  bl, bl
	                JZ   back
	                add  cx, gamebtnOffset
	                add  dx, gamebtnOffset + 2
	                mov  al, [SI]             	;  use color from array color for testing
	                int  10h                  	;  draw the pixel
	                sub  cx, gamebtnOffset
	                sub  dx, gamebtnOffset + 2

	back:           
	                inc  SI
	                DEC  Cx                   	;  loop iteration in x direction
	                JNZ  Drawitgamebtn        	;  check if we can draw c urrent x and y and excape the y iteration
	                mov  Cx, btnsize          	;  if loop iteration in y direction, then x should start over so that we sweep the grid
	                DEC  DX                   	;  loop iteration in y direction
	                JZ   alldrawngamebtn      	;  both x and y reached 00 so finish drawing
	                jmp  Drawitgamebtn
	alldrawngamebtn:ret
drawgamebtn ENDP

drawchatbtn PROC
	; initialize containers
	                mov  SI, offset chatbtn
	                mov  cx, btnsize          	;Column X
	                mov  dx, btnsize + 2      	;Row Y
	                mov  ah, 0ch              	;Draw Pixel Command
	Drawitchatbtn:  
	                mov  bl, [SI]             	;use color from array color for testing
	                and  bl, bl
	                JZ   backchatbtn
	                add  cx, chatbtnOffset
	                add  dx, chatbtnOffset + 2
	                mov  al, [SI]             	;  use color from array color for testing
	                int  10h                  	;  draw the pixel
	                sub  cx, chatbtnOffset
	                sub  dx, chatbtnOffset + 2

	backchatbtn:           
	                inc  SI
	                DEC  Cx                   	;  loop iteration in x direction
	                JNZ  Drawitchatbtn        	;  check if we can draw c urrent x and y and excape the y iteration
	                mov  Cx, btnsize          	;  if loop iteration in y direction, then x should start over so that we sweep the grid
	                DEC  DX                   	;  loop iteration in y direction
	                JZ   alldrawnchatbtn      	;  both x and y reached 00 so finish drawing
	                jmp  Drawitchatbtn
	alldrawnchatbtn:ret
drawchatbtn ENDP


END MAIN